"precision lowp float;
varying vec4 v_fragmentColor;
void main()                              
{ 
    gl_FragColor \x3d v_fragmentColor;      
}
"

"attribute vec4 a_position;
uniform    vec4 u_color;
uniform float u_pointSize;
varying lowp vec4 v_fragmentColor; 
void main(void)   
{
    gl_Position \x3d (CC_PMatrix * CC_MVMatrix) * a_position;  
    gl_PointSize \x3d u_pointSize;          
    v_fragmentColor \x3d u_color;           
}"

