"attribute vec4 a_position; 
attribute vec2 a_texCoord; 
attribute vec4 a_color;  
varying lowp vec4 v_fragmentColor; 
varying mediump vec2 v_texCoord; 
void main() 
{ 
    gl_Position \x3d (CC_PMatrix * CC_MVMatrix) * a_position;  
    v_fragmentColor \x3d a_color; 
    v_texCoord \x3d a_texCoord; 
}"

"precision lowp float;   
varying vec4 v_fragmentColor; 
varying vec2 v_texCoord;   
uniform float CC_alpha_value; 
void main() 
{  
    vec4 texColor \x3d texture2D(CC_Texture0, v_texCoord);  
    if ( texColor.a \x3c\x3d CC_alpha_value )          
        discard; 
    gl_FragColor \x3d texColor * v_fragmentColor;  
}"

"precision lowp float; 
varying vec4 v_fragmentColor; 
varying vec2 v_texCoord; 
uniform sampler2D u_texture;  
uniform sampler2D   u_mask;   
void main()  
{  
    vec4 texColor   \x3d texture2D(u_texture, v_texCoord);  
    vec4 maskColor  \x3d texture2D(u_mask, v_texCoord); 
    vec4 finalColor \x3d vec4(texColor.r, texColor.g, texColor.b, maskColor.a * texColor.a);        
    gl_FragColor    \x3d v_fragmentColor * finalColor; 
}"

"uniform mat4 CC_PMatrix;         
uniform mat4 CC_MVMatrix;        
uniform mat4 CC_MVPMatrix;       
uniform vec4 CC_Time;            
uniform vec4 CC_SinTime;         
uniform vec4 CC_CosTime;         
uniform vec4 CC_Random01;        
uniform sampler2D CC_Texture0;   
//CC INCLUDES END                
"
